import React, { useState,useEffect,useRef } from 'react';
import { Panel } from 'primereact/panel';

import { Calendar } from '@fullcalendar/core';
import timeGridPlugin from '@fullcalendar/timegrid';
import { FullCalendar } from 'primereact/fullcalendar';




export default function Session() {
    const [events, setEvents] = useState(
        [
            {
              title: 'All Day Event',
              start: '2018-01-01',
            },
            {
              title: 'Long Event',
              start: '2018-01-07',
              end: '2018-01-10'
            },
            {
              groupId: 999,
              title: 'Repeating Event',
              start: '2018-01-09T16:00:00'
            },
            {
              groupId: 999,
              title: 'Repeating Event',
              start: '2018-01-16T16:00:00'
            },
            {
              title: 'Conference',
              start: '2018-01-11',
              end: '2018-01-13'
            },
            {
              title: 'Meeting',
              start: '2018-01-12T10:30:00',
              end: '2018-01-12T12:30:00'
            },
            {
              title: 'Lunch',
              start: '2018-01-12T12:00:00'
            },
            {
              title: 'Meeting',
              start: '2018-01-12T14:30:00'
            },
            {
              title: 'Happy Hour',
              start: '2018-01-12T17:30:00'
            },
            {
              title: 'Dinner',
              start: '2018-01-12T20:00:00'
            },
            {
              title: 'Birthday Party',
              start: '2018-01-13T07:00:00'
            },
            {
              title: 'Click for Google',
              url: 'http://google.com/',
              start: '2018-01-28'
            }
          ]
    );

    return (
        <Panel header="Danh sách suất chiếu">
           <div className="card">
                <Calendar events={events} initialDate="2017-02-01" initialView='timeGridPlugin' plugins={[timeGridPlugin]}
                    headerToolbar={{ left: 'prev,next today', center: 'title', right: 'dayGridMonth,timeGridWeek,timeGridDay' }} editable selectable selectMirror dayMaxEvents />
            </div>
        </Panel>
    )
}
